  LOADLIN: true
  LINEAR_SOLVER: 1
STRUCT NOX/Printing:
  Inner Iteration: false
  Outer Iteration StatusTest: false
MATERIALS:
  - MAT: 1
    MAT_Struct_StVenantKirchhoff:
      YOUNG: 100
      NUE: 0
      DENS: 0
FUNCT1:
  - COMPONENT: 0
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "(1+0.2*y+0.4*z)*t"
DESIGN SURF NEUMANN CONDITIONS:
  - E: 2
    NUMDOF: 6
    ONOFF: [1, 0, 0, 0, 0, 0]
    VAL: [10, 0, 0, 0, 0, 0]
    FUNCT: [1, 0, 0, 0, 0, 0]
DESIGN SURF DIRICH CONDITIONS:
